import React, { Component } from 'react'
import { Result, Button } from 'antd';
import { Link } from 'react-router-dom';

export default class Success extends Component {

    render() {
        //获取从上个页面传来的信息
        const isChanged = this.props.location.state
        return (
            <div>
                <Result
                    status="success"
                    title={"你已经成功提交至" +
                        (isChanged === "tipoff" ? "网上举报平台" : "首长信箱")
                        + "，请耐心等待解答"}
                    extra={[
                        <Link to='/'><Button type="primary" key="home">回网站主页</Button></Link>,
                        <Link to={{
                            pathname: isChanged === "tipoff" ? '/tipoff' : '/mail'
                        }}>
                            <Button key="again">{isChanged === "tipoff" ? "继续向纪委举报" : "继续向首长反应情况"}</Button>
                        </Link>

                    ]}
                />
            </div>
        )
    }
}
